import { useState,useEffect } from "react";

const Form = ()=>{

    return (
        <form>
            <label htmlFor="email"/>
            <input type="text" name='email'  />
            <label htmlFor="password"/>
            <input type="text" name='password'  />
            <button>Submit</button>
        </form>
    )    
}

export default Form;
